import React from 'react';
import { Text, TextInput, Button } from 'react-native';
import Logo from "../../assets/images/Logo.jpg";

function SignIn(props) {
    return (
        <div>
            <Text><Imag scr={Logo} />Signup</Text>
            
        </div>
    );
}

export default SignIn;
